import { makeStyles, StylesProvider } from '@material-ui/core/styles';


export default makeStyles({

    card: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
        width: 400,
        float: 'right'

    },


    form: {
        display: 'flex',
        flexDirection: 'column',


        alignItems: 'center'
    },
    avatar: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'

    },
    button: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
    },
    textField: {
        width: '100%'
    }



})
